import Link from 'next/link';

const Header = () => (
    <ul className="nav">
        <li className="nav-item">
            <Link className="nav-link" href="/about">
                <a>Home</a>
            </Link>
        </li>
        <li className="nav-item">
            <Link className="nav-link" href="/about">
                <a>About</a>
            </Link>
        </li>
    </ul>
);

export default Header;
